import React from "react";
import InputText from "../UI/Forms/InputText";

class ProfilePage extends React.Component {
  state = {
    fullName: "",
    email: "",
    phone: "",
    currentPassword: "",
    newPassord: "",
    reapeatPassword: ""
  };

  render() {
    return (
      <div>
        <h1>ProfilePage</h1>
        <form action=''>
          <InputText
            label='Test Name'
            placeholder='Test Name'
            name='TestName'
            minLength={3}
          />
          <button type='submit'>Create New User</button>
        </form>
      </div>
    );
  }
}

export default ProfilePage;
